#include "eos_rtpress.h"
#include "monitor.h"

/* compared to the lookup approach, rtpress is derived in terms of temperature and volume, which
   means we must take the current pressure and entropy and jointly solve for T and V.  Then we can use this T
   and V to solve for the other material properties.  This partly motivates the idea of updating material properties
   once in an EOSEvalData struct, since otherwise we have to keep resolving for V and T from P and S, which will add
   a lot of additional solves when evaluating EOS */

/* Prototypes for local functions used in EOS interface functions */
static PetscErrorCode EOSRTpress_GetAlpha(const data_EOSRTpress*,PetscScalar,PetscScalar,PetscScalar*);
static PetscErrorCode EOSRTpress_GetCp(const data_EOSRTpress*,PetscScalar,PetscScalar,PetscScalar*);
static PetscErrorCode EOSRTpress_GetCv(const data_EOSRTpress*,PetscScalar,PetscScalar,PetscScalar*);
static PetscErrorCode EOSRTpress_GetdTdPs(const data_EOSRTpress*,PetscScalar,PetscScalar,PetscScalar*);
static PetscErrorCode EOSRTpress_GetPressure(const data_EOSRTpress*,PetscScalar,PetscScalar,PetscScalar*);
static PetscErrorCode EOSRTpress_GetRho(const data_EOSRTpress*,PetscScalar,PetscScalar,PetscScalar*);
static PetscErrorCode EOSRTpress_GetVolumeTemperature(const data_EOSRTpress*,PetscScalar,PetscScalar,PetscScalar*,PetscScalar*);

/* Functions to implement EOS interface */
static PetscErrorCode EOSDestroy_RTpress(EOS eos)
{
  PetscErrorCode ierr;

  PetscFunctionBegin;
  SETERRQ(PETSC_COMM_WORLD,PETSC_ERR_SUP,"Not Implemented!");
  ierr = PetscFree(eos->impl_data);CHKERRQ(ierr);
  eos->impl_data = NULL;
  PetscFunctionReturn(0);
}

static PetscErrorCode EOSEval_RTpress(EOS eos, PetscScalar P, PetscScalar S, EOSEvalData *eval)
{
  PetscErrorCode   ierr;
  data_EOSRTpress *rtp = (data_EOSRTpress*) eos->impl_data;

  PetscFunctionBegin;
  eval->P = P;
  eval->S = S;
  ierr = EOSRTpress_GetVolumeTemperature( rtp, P, S, &eval->V, &eval->T );CHKERRQ(ierr);
  ierr = EOSRTpress_GetdTdPs( rtp, eval->V, eval->T, &eval->dTdPs );
  ierr = EOSRTpress_GetCp( rtp, eval->V, eval->T, &eval->Cp );
  ierr = EOSRTpress_GetCv( rtp, eval->V, eval->T, &eval->Cv );
  ierr = EOSRTpress_GetRho( rtp, eval->V, eval->T, &eval->rho );
  ierr = EOSRTpress_GetAlpha( rtp, eval->V, eval->T, &eval->alpha );
  PetscFunctionReturn(0);
}

/* Creation Function */
PetscErrorCode EOSCreate_RTpress(EOS eos) {
  PetscErrorCode    ierr;
  data_EOSRTpress  *rtp;

  PetscFunctionBeginUser;
  SETERRQ(PETSC_COMM_WORLD,PETSC_ERR_SUP,"Not Implemented!");
  eos->eval = EOSEval_RTpress;
  eos->destroy = EOSDestroy_RTpress;
  eos->setupfromoptions = NULL;

  ierr = PetscMalloc1(1, (data_EOSRTpress**) (&eos->impl_data));CHKERRQ(ierr);
  rtp = (data_EOSRTpress*) eos->impl_data;

  /* for unit conversion */
  rtp->PV_UNIT = 160.21766208; /* GPa*Ang^3/eV */
  /* first value is KBOLTZ in units of eV/K */
  /* TODO: use BOLTZMANN from FundamentalConstants */
  rtp->KBOLTZ = 8.617333262145e-5 * rtp->PV_UNIT; /* GPa*Ang^3/K, this is energy / temperature */
  /* TODO: check with ASW: is 3000=T0 and 0.6=m? */
  /* 0.6 could instead be a reference compression? (V/V0) */
  /* still seems likely that T0 is a reference temperature scale */
  rtp->bscale = 0.6/3000 * rtp->PV_UNIT / rtp->KBOLTZ; /* K/eV, FIXME: if leading constant are unitless */

  rtp->V0 = 14.74; /* Ang^3/atom */
  rtp->T0 = 3000.0; /* K */
  rtp->S0 = 0.0; /* GPa*Ang^3/K, this is energy / temperature  */
  rtp->K0 = 9.77; /* GPa */
  rtp->KP0 = 7.42; /* non-dimensional */
  rtp->E0 = -6.85 * rtp->PV_UNIT; /* GPa*Ang^3/atom */
  rtp->gamma0 = 0.282; /* non-dimensional */
  rtp->gammaP0 = -1.35; /* non-dimensional, since gammaP0 = V0 (dgamma/dV)_0 */
  rtp->m = 0.6; /* non-dimensional */
  rtp->b0 = 1.118 * rtp->bscale; /* FIXME: units? */
  rtp->b1 = -0.05 * rtp->bscale; /* FIXME: units? */
  rtp->b2 = 2.1 * rtp->bscale; /* FIXME: units? */
  rtp->b3 = 12.9 * rtp->bscale; /* FIXME: units? */
  rtp->b4 = 15.5 * rtp->bscale; /* FIXME: units? */

  /* MgSiO3 has a molar mass of 100.39 g/mol and 5 atoms */
  /* So (average) molar mass of an atom is 20 g/mol/atom */
  rtp->mavg = 20.0E-3; /* kg/mol/atom */

  rtp->AVOGADRO = 6.02214076E23; /* 1/mol */ // FIXME duplicated with Fundamental constants..

  PetscFunctionReturn(0);
}


/* Helper Functions */

static PetscScalar per_atom_to_specific( PetscScalar per_atom_value, PetscScalar mavg, PetscScalar Avogadro )
{
    /* convert from per atom to specific */

    PetscScalar specific_value;
    specific_value = per_atom_value * Avogadro / mavg;
    return specific_value;
}

static PetscScalar specific_to_per_atom( PetscScalar specific_value, PetscScalar mavg, PetscScalar Avogadro )
{
    /* convert from specific to per atom */

    PetscScalar per_atom_value;
    per_atom_value = specific_value * mavg / Avogadro;
    return per_atom_value;
}

static PetscScalar joule_to_eV( PetscScalar joule )
{
    /* convert from joules to eV */
    return joule * 6.242E18;
}

static PetscScalar eV_to_joule( PetscScalar eV )
{
    /* convert from eV to joules */
    return eV * 1.60218E-19;
}

